          "nb" : "Økonomi- og styringsavdelingen har regimeansvar for helhetlig risikostyring i NAV. Som en del av det helhetlige risikostyringssystemet i NAV har Økonomi- og styringsavdelingen definert prosesser og verktøy for operativ risikostyring.  Sikkerhetsområdet omfattes av dette.Risikostyring benyttes for å kunne presentere et risikobilde og dermed være istand til å velge ut tiltak som treffer så presist som muligRisikostyring for sikkerhetsområdet er også omfattet av den helhetlige risikostyringen for å kunne presentere et risikobilde for personvern, informasjonssikkerhet og beredskap og dermed være istand til å velge ut sikkerhetstiltak som treffer så presist som mulig. Metoden som benyttes er basert på ISF sin metode IRAM2."
        },
