      "definition" : {
        "text" : {
          "nb" : "lønnsinntekt opptjent på Svalbard over 12G skattlegges etter reglene om lønnstrekk når en person er skattemessig bosatt på Svalbard, eller oppholdet i forbindelse med arbeid varer minst 30 dager. Lønn over 12G har en høyere skattesats."
        },
        "remark" : {
          "nb" : "Skatten etter lønnstrekkordningen er en ren bruttoskatt. Det gis derfor ingen fradrag i beregningsgrunnlaget for skatt. Arbeidsgiveren skal trekke skatt av lønn/pensjon ved utbetaling til arbeidstakeren/ trygdemottakeren. Skattetrekket er i utgangspunktet endelig oppgjør for skatteforpliktelsen på lønnen/pensjonen. Fra dette hovedprinsippet gjelder ett unntak for de som mottar lønn/pensjon fra flere arbeidsgivere når lønnen/pensjonen samlet utgjør mer enn 12 G dersom skattetrekket er for lavt. I slike tilfeller vil du selv være ansvarlig for å betale inn skatt med høy sats på overskytende lønn/pensjon over 12 G."
        },
