        "text" : {
          "nb" : "samlet pensjonsinntekt er grunnlaget for beregningen av skattefradraget. Samlet pensjonsinntekt omfatter all inntekt som skal skattlegges som pensjon. Arbeidsinntekt, kapitalinntekt, fradrag i inntekten og eventuell formue inngår ikke i beregningsgrunnlaget."
        },
        "remark" : {
          "nb" : "Samlet pensjonsinntekt beregnes for skattepliktige som oppfyller vilkår for å motta skattefradrag for pensjonsinntekt. Frem til og med 2014 var utbetalinger til ufør en pensjonsytelse og var av den grunn som en del av de beløp som inngikk i samlet pensjonsinntekt. Fra og med 2015 byttet uførepensjon navn til hhv uføretrygd fra folketrygen og uføreytelser fra andre enn folketrygden, fordi uføretrygd og -ytelser skulle behandles som lønnsinntekt, med unntak av i forbindelse med \"Samlet pensjonsinntekt\". Her skulle uføretrygd og -ytelser fortsatt kunne være med i summeringen. Det er kun når uføretrygd, uføreytelser eller andre pensjoner utbetales samtidig som alderspensjon det inkluderes i samlet pensjonsinntekt. All uføretrygd, uføreytelser og andre pensjoner som har blitt utbetalt FØR alderspensjon tas ut, skal holdes utenfor samlet pensjonsinntekt."
        },
        "sources" : [ ]
