          "nb" : "individuell pensjonsordning utformet som pensjonsforsikringsavtale, eller som pensjonsspareavtale, og er etablert før 1.11.2017"
        },
        "remark" : {
          "nb" : "Ordningen stenges for nytegning fra 1.11.2017. Den er erstattet av ny ording om skattefavorisert individuell sparing til pensjon. De som har en eksisterende individuell pensjonsavtale (IPS) kan fortsette å spare på denne, men maksimalt samordnet årlig inntektsfradrag kan uansett ikke overstige 40 000 kroner for gammel og ny ording. \n\nÅrlig inntektsfradrag (og innbetaling) i individuell pensjonsavtale (IPS) er begrenset oppad til 15000 kroner per person. Pensjonsavtaler i medhold av loven må gi pensjonssparer rett til alderspensjon, men kan i tillegg omfatte forsikringer som dekker innskuddsfritak eller premiefritak ved uførhet, rett til uførepensjon, eller andre uføreytelser, etterlattepensjon og barnepensjon. Pensjonskapitalen er bundet til oppnådd pensjonsalder (variabel fra 62 til 70 år)."
        },
        "source" : {
