      "example" : {
        "nb" : "Det er viktig at familiebarnehagevirksomhet og privat dagmammavirksomhet ikke forveksles . Selv om det i begge tilfeller dreier seg om pass og stell av barn, er det store ulikheter. Familiebarnehageordningen og hjemmet må godkjennes av kommunen, familiebarnehagen får pedagogisk veiledning og den mottar offentlige tilskudd. Privat dagmammavirksomhet i barnepassers hjem er ikke underlagt kommunal kontroll og mottar ikke offentlig driftsstøtte."
