      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "er en latent og beregnet nettogevinst som skattyter anses å ha på sine urealiserte aksjer og andeler mv. på tidspunktet for opphør av skatteplikt til Norge etter intern rett eller på tidspunktet for endret bosted etter skatteavtale"
        },
        "remark" : {
          "nb" : "Sktl. § 10-70 og FSFIN § 10-70 har regler om skattlegging av latente aksjegevinster mv. ved utflytting. Reglene innebærer at personlige skattytere som flytter til utlandet med latente gevinster på aksjer eller andeler i norske eller utenlandske selskaper, skal skattlegges som om aksjene eller andelene mv. var realisert siste dag før skattyters skatteplikt som bosatt i Norge etter intern rett opphører, eller siste dag før skattyter anses bosatt i et annet land etter skatteavtale. Reglene gjelder bare for samlet netto gevinst/tap som overstiger et beløp fastsatt i skatteloven, jf. sktl. § 10-70 tredje og fjerde ledd. Det gis utsettelse med betalingen av skatten frem til faktisk realisasjon, hvis det stilles betryggende sikkerhet. Det gis utsettelse uten sikkerhetsstillelse når skattyter flytter til en stat innenfor EØS, når Norge i medhold av skatteavtale eller annen folkerettslig overenskomst kan kreve opplysninger om skattyters inntekts- eller formuesforhold, samt bistand til innfordring. Skatteplikten faller bort hvis aksjene ikke er realisert innen fem år etter utflytting, eller hvis skattyter igjen blir bosatt i Norge etter intern rett eller skatteavtale."
        },
