      "definition" : {
        "text" : {
          "nb" : "kostpris for en gitt eier på et bestemt tidspunkt for en enkelt eiendel, forpliktelse eller en avgrensbar gruppe eiendeler eller forpliktelser, eller i stedet for kostpris kan det være nærmere regelbestemt at inngangsverdien er skattemessig verdi, skattemessig nedskrevet verdi eller saldoverdi, videreført kostpris mv. fra tidligere eier i forbindelse med arv/gave, eller annen verdi ved arv/gave"
        },
        "remark" : {
          "nb" : "En bruker inngangsverdien for å fastsette gevinst eller tap etter eventuell skattepliktig realisasjon, eller for å fastsette inntekt ved en annen aktuell skattemessig begivenhet for eksempel fradragsføring, aktivering, restbeløp til avskrivning. Dette er også skattebestemmelser som tilsier at inngangsverdien i stedet for kostpris bestemmes ut fra disposisjoner innenfor eierens egen økonomi, som for eksempel at omstendighetene rundt eiendelen eller virksomhet har medført at eiendelen er uttaksbeskattet etter skatteloven § 5-2; driftsmiddel er tatt inn i norsk beskatningsområde fra utlandet, jamfør skatteloven § 14-61; driftsmiddelet er tatt ut fra norsk beskatningsområde til utlandet med inntektsoppgjør etter skatteloven § 14-62 andre ledd; eiendel har gått over i nytt skatteordning som utløser skatteplikt for gevinst eller fradragsrett for tap, for eksempel etter uttredeen av rederiskatteordningen jamfør skatteloven § 8-17 andre ledd; eiendelen er tatt ut fra norsk beskatningsområde på et sett som medførte skatteplikt etter skatteloven § 9-14; aksjen eller andel ble gevinstbeskattet etter § 10-70 i forbindelse med at eierens skatteplikt til riket opphørte."
        },
